function Card(props) {
    function handleClick() {
        props.onCardClick(props.item);
    }
    return(
        <article className="element">
        <button className="element__delete-btn" type="button" />
        <img src={props.link} alt={props.name} className="element__item" onClick={handleClick}/>
        <div className="element__wrapper">
            <h2 className="element__title">{props.name}</h2>
            <div className="element__like">
                <button className="element__like-btn" type="button" />
                <span className="element__like-count">1</span>
            </div>
        </div>
    </article>
    )
}
export default Card
